package test.raon.data;

import java.nio.charset.Charset;

import org.junit.Test;

import com.wowsanta.raon.impl.data.INT;
import com.wowsanta.util.Hex;


public class IntBufferTest {

	@Test
	public void test() {
		//875769911  
		INT value1 = new INT(875769911);
		System.out.println("value : " + value1.toBytes());
		System.out.println("value : " + Hex.toHexString(875769911));
		
		INT value2= new INT(65792);
		System.out.println("value : " + value2.toBytes());
		System.out.println("value : " + Hex.toHexString(67072));
	}
	
	@Test
	public void test_parser() {
		byte[] data = Hex.toByteArray("");
		
		System.out.println(new String(data,Charset.forName("euc-kr")));
	}
	
}
